import './App.css';
import {BrowserRouter as Router, Routes, Route } from 'react-router-dom'
import Login from './User/Login';


function App() {
  return (
    <Router>
      <Routes>
        {/* user */}
          <Route path = '/' exact element = {<Login/>} />
      </Routes>
    </Router>
  );
}

export default App;
